import React from "react";

import { useSelector } from "react-redux";

import productData from "../assets/fake-data/products";

const Cart = () => {
  const cartItemms = useSelector((state) => state.cartItems.value);
  console.log(productData.getCartItemsDetal(cartItemms));
  return <div>Cart</div>;
};
export default Cart;
